// src/pages/Settings.js
import React from 'react';
import { Container, Typography, Paper } from '@mui/material';

export const Settings = () => {
  return (
    <Container>
      <Paper sx={{ p: 3, mt: 3 }}>
        <Typography variant="h4">Settings</Typography>
        {/* Add settings content here */}
      </Paper>
    </Container>
  );
};
